function App() {
  return (
    <div className="App">
      <div className="portfolioHeader">       
        <h1>Gil Pena Portfolio</h1>
      </div>
      <div className="FirstRow">
        <div class="card">
          <div class="card-title"> About Me</div>
        </div>

      </div>
    </div>
  );
}

export default App;
